import React, { Fragment } from 'react';
import CssBaseline from '@material-ui/core/CssBaseline';
import Drawer from './components/template/Drawer';
import Home from './pages/Home';
import { Container } from '@material-ui/core';

const App = () => {
  return (
    <Fragment>
      <CssBaseline/>
      <Drawer>
        <Container>
          <Home/>
        </Container>
      </Drawer>
    </Fragment>
  );
}

export default App;
